function Hero() {
    return (
        <div className="jumbotron jumbotron-fluid d-flex justify-content-center align-items-center" id="hero">
            <div id="heroContent">
                <h1 className="display-4">Above average</h1>
                <p className="lead">and often better than necessary.</p>
                <a className="btn btn-primary btn-lg" href="#workLink" role="button">WORK</a>
            </div>
        </div>
    );
}

export default Hero;
